class Solution(object):
    def maxDistance(self, grid):
        """
        :type grid: List[List[int]]
        :rtype: int
        """
        M = len(grid)
        N = len(grid[0])
        DIRECTIONS = ((-1, 0), (1, 0), (0, -1), (0, 1))

        from collections import deque
        bfs = deque()

        # start search from all lands
        for x in range(M):
            for y in range(N):
                if grid[x][y] == 1:
                    bfs.append((x, y))

        ans = 0
        while bfs:
            ans += 1
            size = len(bfs)
            for n in range(size):
                x, y = bfs.popleft()
                for direction in DIRECTIONS:
                    nx = x + direction[0]
                    ny = y + direction[1]
                    if 0 <= nx < M and 0 <= ny < N:
                        if grid[nx][ny] == 0:
                            bfs.append((nx, ny))
                            grid[nx][ny] = 1

        if ans <= 1:
            return -1
        else:
            return ans - 1


